    const { data, loading, error} = useQuery(MY_BRANKS);
    //console.log("Bank Accounts:", data)

    if (error) return <p>Oooops...Something went wrong!</p>
    if (loading) return <p>Loading...!</p>  
    return (
        <div>
            <h1>i am from Bank Account page components</h1>
        </div>
    )
}

